  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Louisa and Keithsburg
  National Wildlife Refuges outlines Refuge accomplishments from May 1946 through
  April of 1947. The report begins by summarizing the weather conditions and water
  conditions during this period. Wildlife- including migratory birds, upland game
  birds, big game animals, furbearers, raptors, and fish- is also covered. The Refuge
  development and maintenance section discusses physical developments. The public
  relations section of the report describes Refuge visitors and violations. N-R forms
  are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
